import React from "react";
import { NavLink } from "react-router-dom";
import web from "./img/best-seller.png";
import web2 from "./img/reading-book.png";

const Common = (props) => {
  return (
    <>
      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="row">
                <div className="col-md-6 pt-4 pt-lg-3 order-1 order-lg-1 d-flex justify-content-center flex-column">
                  <h1>
                    Welcome to {props.pagename} Page <br/>
                    <strong className="brand_name">  BootStrap </strong>
                  </h1>
                  <h4 className="my-3">
                    We are the team of talented developer making websites
                  </h4>
                  <div className="mt-3">
                    <NavLink to={props.visit} className="btn-get-started">
                      {props.btnname}
                    </NavLink>
                  </div>
                </div>
                <div className="col-lg-6 order-2 order-lg-2 ">
                  <img
                    src={props.imgsrc}
                    className="img-fluid animated"
                    alt="home img"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Common;
